INSERT INTO `news` VALUES (1,'За три дня на прием в Госкомрегистр записались около 9 тысяч заявителей.',' По состоянию на 2 декабря 17.00 на прием в Государственный комитет по государственной регистрации и кадастру Республики Крым записались около 9 тысяч заявителей. Об этом сообщил председатель Госкомрегистра Александр Спиридонов.\r\n«В Симферопольский отдел приема-выдачи документов записались более двух тысяч человек. Все заявители будут приняты за две недели с 10 по 25 декабря. На данный момент есть ещё свободные даты в восьми теротделах, поэтому граждане могут прямо сейчас зарегистрироваться в си....',' По состоянию на 2 декабря 17.00 на прием в Государственный комитет по государственной регистрации и кадастру Республики Крым записались около 9 тысяч заявителей. Об этом сообщил председатель Госкомрегистра Александр Спиридонов.\r\n«В Симферопольский отдел приема-выдачи документов записались более двух тысяч человек. Все заявители будут приняты за две недели с 10 по 25 декабря. На данный момент есть ещё свободные даты в восьми теротделах, поэтому граждане могут прямо сейчас зарегистрироваться в системе и выбрать необходимую для них услугу», - рассказал руководитель ведомства.\r\n<p></p>\r\n37% заявителей воспользовались интернет-ресурсом, 63% - записались в банковских отделениях.  Активно продолжают пользоваться предварительной электронной записью юридические лица.\r\nНапомним, записаться на прием в Госкомрегистр можно удаленно через портал Правительства РК https://eo.gkreg.rk.gov.ru/login или в отделениях банков «РНКБ» и «Генбанк».\r\n<br></br>\r\nТехническая поддержка: +7 (978) 00-00-910\r\n<p></p>\r\nE-mail: support@krtech.ru, gkreg_ip@rk.gov.ru\r\n<p></p>\r\nЕдиный многоканальный номер справочной службы Госкомрегистра: (3652) 66 -74 -00.\r\n<br></br>\r\n<b>Открытие следующей предварительной записи готовится к 28 декабря.</b>','2015-12-02 00:00:00','NEWS',1,1079),(2,'Госкомрегистр презентовал новый многофункциональный сall-центр','Государственный комитет по государственной регистрации и кадастру Республики Крым стал первым органом исполнительной власти в Республике Крым, который открыл собственный многофункциональный сall-центр. Об этом сегодня на торжественном открытии центра представителям СМИ сообщил председатель Госкомрегистра Александр Спиридонов.\r\n<p></p>\r\nАжиотаж на услуги регистрирующего органа во многом связан с недостаточной осведомлённостью граждан. Главная цель для комитета – совершенствование взаимодействия с....','Государственный комитет по государственной регистрации и кадастру Республики Крым стал первым органом исполнительной власти в Республике Крым, который открыл собственный многофункциональный сall-центр. Об этом сегодня на торжественном открытии центра представителям СМИ сообщил председатель Госкомрегистра Александр Спиридонов.\r\n<p></p>\r\nАжиотаж на услуги регистрирующего органа во многом связан с недостаточной осведомлённостью граждан. Главная цель для комитета – совершенствование взаимодействия с заявителями.\r\n<p></p>\r\n«Госкомрегистр стремится быть авангардом для других органов власти, предоставляющих услуги населению. Новый сall-центр будет взаимодействовать с заявителями сразу на нескольких фронтах: предоставление информации по стационарному и мобильному телефону, онлайн-специалист в социальных сетях: facebook и vkontakte, автоматически всплывающее окно консультации при заходе на сайт ведомства. Также, что особенно важно для жителей других стран, получить ответы можно будет с помощью программы Skype», - сообщил глава ведомства.\r\n<p></p>\r\n5 специалистов комитета будут осуществлять предварительные консультации граждан с понедельника по пятницу с 9.00 до 18.00.\r\n<br></br>\r\nЕдиный номер справочной службы: (3652) 66-74-00\r\n<p></p>\r\nОнлайн-консультант в вконтакте: https://vk.com/id337327368\r\n<p></p>\r\n(Официальная группа Госокмрегистра вконтакте) https://vk.com/goskomregistr\r\n<p></p>\r\nОнлайн-консультант в Фейсбуке https://www.facebook.com/goskomregistr/\r\n<p></p>\r\nSkype: gk_reg или Госкомрегистр\r\n<p></p>\r\n<b>Онлайн-консультант на официальном сайте Госкомрегистра http://gkreg.rk.gov.ru (работает по принципу всплывающего окна)</b>\r\n<p></p>\r\n<b>Горячая линия (для жалоб, касающихся учётно-регистрационной сферы) +79781085365</b>','2015-12-07 00:00:00','NEWS',1,4411),(3,'С сегодняшнего дня получить услуги Госкомрегистра можно в новом Симферопольском многофункциональном центре','C сегодняшнего дня получить услуги Государственного комитета по государственной регистрации и кадастру можно в новом самом крупном в Крыму Симферопольском едином центре оказания государственных услуг на проспекте Кирова, 41. Об этом сообщил председатель Госкомрегистра Александр Спириднов, принявший участие в официальном открытии центра.\r\n<p></p>\r\nРуководитель регистрирующего органа протестировал возможность подать документы для постановки объекта недвижимости на кадастровый учёт. Александр Спири....','C сегодняшнего дня получить услуги Государственного комитета по государственной регистрации и кадастру можно в новом самом крупном в Крыму Симферопольском едином центре оказания государственных услуг на проспекте Кирова, 41. Об этом сообщил председатель Госкомрегистра Александр Спириднов, принявший участие в официальном открытии центра.\r\n<p></p>\r\nРуководитель регистрирующего органа протестировал возможность подать документы для постановки объекта недвижимости на кадастровый учёт. Александр Спиридонов выбрал соответствующую услугу в специальном терминале, получил талон и прошел к указанному окну. Глава комитета задал специалисту вопросы, касающиеся учётно-регистрационной сферы.\r\n<p></p>\r\n«Я неспроста устроил небольшой расспрос. Сотрудники МФЦ проходили обучение у квалифицированных специалистов Госкомрегистра. Для нас очень важно, чтобы при приеме документов не возникало ошибок. Фундамент заложен, теперь необходимо выстроить чёткую рабочую систему: качественный прием и обработка документов, квалифицированные консультации, упорядоченное межведомственное взаимодействие», - отметил руководитель Госкомитета.\r\n<p></p>\r\nАлександр Спиридонов поздравил с открытием центра директора Симферопольского территориального подразделения ГБУ РК «МФЦ» Оксану Бородай и обсудил с ней рабочие моменты. Начальник отделения отметила, что на проспекте Кирова выделены 6 специализированных окон, которые готовы принимать документы для регистрации прав собственности и постановки на кадастровый учёт объектов недвижимости. Также руководитель напомнила, что на данный момент функционируют ещё 6 окон в МФЦ на ул. Толстого 15, которые принимают документы у юридических лиц.\r\n<p></p>\r\nПо официальной информации, изложенной в ежегодном отчете Правительства Российской Федерации за 2014 год, порядка 70% заявлений, поданных в МФЦ, относятся к учётно-регистрационной сфере.','2015-11-11 00:00:00','NEWS',1,8696),(5,' запись в Госкомрегистр ','','Новый период предварительной электронной записи на прием в Государственный комитет по государственной регистрации и кадастру Республики Крым будет доступен с 12 февраля. Об этом сообщил председатель Госкомрегистра Александр Спиридонов.\r\n«В 9.00 запись откроется в отделениях банков РНКБ и ГЕНбанк. Удаленно, с помощью личных кабинетов системы, юридические лица смогут записаться на прием в комитет с 9.00, физические лица - с 18.00. Временной период — 4 недели», - подчеркнул глава регистрирующего органа.\r\nАлександр Спиридонов отметил, что заявители, у которых строгий рабочий график, смогут выбрать для записи субботу или вечерние часы приема с 18.00 до 20.00.\r\nЗаписаться удаленно можно через официальный Портал Правительства РК https://eo.gkreg.rk.gov.ru/login или в отделениях банков «РНКБ» и «Генбанк».\r\nТехническая поддержка:\r\nE-mail: support@krtech.ru, gkreg_ip@rk.gov.ru\r\nТелефоны: +7 (978) 00-00-910\r\nЕдиный номер многоканальной справочной службы Госкомрегистра: (3652) 66-74-00, «горячая линия» Госкомрегистра +79781085365.','2016-01-29 00:00:00','NEWS',1,10704),(6,'Запись в очередь через банк','