ом No7','2016-04-28 00:00:00','NEWS',1,10341),(7,'За 10 дней на прием в Госкомрегистр записалось более 50 тысяч человек — Александр Спиридонов','','За 10 дней на прием в Государственный комитет по государственной регистрации и кадастру Республики Крым записалось более 50 тысяч человек. Председатель Госкомрегистра Александр Спиридонов подвел итоги предварительной записи в мае.\r\n«В день открытия (29 апреля) мы рассчитывали на поступление 45 тысяч заявок в электронной системе. Однако текущая запись побила и прошлый рекорд и наши ожидания. По состоянию на 10 мая свободные даты остаются еще в трех территориальных отделах: Керченском, Ялтинском и Армянском», - рассказал руководитель ведомства.\r\n<br>\r\nВопросы, относительно записи на прием в комитет, можно задать по специальным телефонам «горячей линии» ведомства: <b>+79781085365, +79782282974, +79782282970, +79782283043</b>. \r\n<br>\r\nЕдиный номер многоканальной справочной службы Госкомрегистра: (3652) 66-74-00.\r\n<br>\r\nАлександр Спиридонов также отметил, что открытие следующего периода предварительной записи планируется на 24 июня.\r\nНапомним, помимо предварительной записи документы в Госкомрегистр можно сдать через отделения МФЦ или в электронном виде через портал Росреестра.','2016-05-11 00:00:00','NEWS',1,7382);
