  `before_max_advance` int(11) NOT NULL DEFAULT '10' COMMENT 'Максимальное время предварительного прихода пользователя (за сколько времени до назначенного ему времени он может прйти)',
  `next_opening_date` date DEFAULT NULL,
  `lock_phys_queue_until` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;
