INSERT INTO `static_pages` VALUES (1,'about','Об очереди','<p class=\"text-color_2 acss_mt10\">\n                    «Электронная очередь в Государственный комитет регистрации и кадастра Республики Крым» — он-лайн система, разработанная и внедренная специалистами предприятия ГУП РК «Крымтехнологии» для удобства крымчан в получении электронных государственных услуг. Система разработана по поручению Министерства внутренней политики, информации и связи и главы Крыма Сергея Аксёнова. Услуга введена в эксплуатацию 1 сентября 2015 г.\n                  </p>\n                  <p class=\"text-color_2 acss_mt10\">\n                  	Электронная очередь в госкомрегистр — это средство для предварительной записи собственников недвижимого имущества на приём в Государственный комитет регистрации и кадастра для регистрации недвижимого имущества, перерегистрации прав на имущество, а также получения сведений о государственной регистрации.\n                  </p>\n                  <p class=\"text-color_2 acss_mt10\">\n                  	По словам председателя Госкомрегистра Александра Спиридонова, электронная очередь – это возможность облегчить крымчанам доступ к услугам комитета и избежать фактов спекуляции местами в очереди.\nПредварительно записаться в очередь можно через интернет или в отделениях банков-партнеров. Для этого сотрудники ГУП РК «Крымтехнологии» провели обучение банковских работников, которые стали операторами электронной очереди.\n                  </p>','2015-12-14 14:06:39'),(2,'info_jur','Юридическим лицам','<p class=\"text-color_2 acss_mt10\">\n                    В системе предварительной электронной записи в Государственный комитет по государственной регистрации и кадастру Республики Крым созданы отдельные кабинеты для юридических лиц через которые, они могут получить талон на приём в Государственный комитет по регистрации и кадастру Республики Крым.\n                  </p>                                                 \n                  <p class=\"text-color_2 acss_mt10\">\n                  	Отличие кабинетов для юрлиц состоит, в необходимости обязательно указывать ИНН\n                  </p>\n                  <p class=\"text-color_2 acss_mt10\">\n                  	На данный момент у юридических лиц есть возможность взять талон раз в день на один адрес.\n                  </p>','2015-12-14 14:06:39'),(3,'info_ph','Физическим лицам','<p class=\"text-color_2 acss_mt10\">\n                    Физические лица, желающие осуществить предварительную запись в отделения Государственного комитета по государственной регистрации и кадастру Республики Крым, могут пройти он-лайн регистрацию в системе предварительной записи только после ознакомления с правилами регистрации и политикой конфиденциальности. \n                  </p>                                                 \n                  <p class=\"text-color_2 acss_mt10\">\n                  	Для успешного прохождения регистрации пользователь должен заполнить все обязательные поля, а также обратить внимание на корректность паспортных данных.\n                  </p>','2015-12-14 14:06:39'),(7,'faq','Часто задаваемые вопросы','<script type=\"text/javascript\">\r\n    $(document).ready(function($) {\r\n        $(\'#accordion\').find(\'.accordion-toggle\').click(function(){\r\n\r\n            //Expand or collapse this panel\r\n            $(this).next().slideToggle(\'fast\');\r\n\r\n            //Hide the other panels\r\n            $(\".accordion-content\").not($(this).next()).slideUp(\'fast\');\r\n\r\n        });\r\n    });\r\n</script>\r\n<style>\r\n    #accordion .accordion-toggle{\r\n        font-size:18px;\r\n        cursor:pointer;\r\n        margin-top:15px;\r\n    }\r\n    #accordion .item-card__description{\r\n        margin-top:15px;\r\n    }\r\n</style>\r\n<div id=\"accordion\">\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Почему Система не позволяет выбрать дату?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вариант 1: В данном отделении пока нет свободных талонов<br>\r\n    Вариант 2: Проверьте правильно ли выбран месяц, возможно Вы пытаетесь выбрать дату в том месяце, который уже прошёл, или еще не открыт.\r\n    </p></div>\r\n\r\n	<h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Какой вид услуги мне выбрать?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Если вы сомневаетесь какой вид услуги выбрать, то обязательно проконсультируйтесь со специалистами Госкомрегистра по телефону +7(978) 108-53-65. Если вид услуги будет указан не верно, талон не будет считаться действительным.\r\n    </p></div>\r\n    \r\n	<h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Какие документы необходимы для осуществления услуги?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Информация об услугах и документах необходимых для их осуществления расположена на сайте Госкомрегистра: <a href=\"http://gkreg.rk.gov.ru/rus/info.php?id=608128\">http://gkreg.rk.gov.ru/rus/info.php?id=608128</a> <a href=\"http://gkreg.rk.gov.ru/rus/info.php?id=623747\">http://gkreg.rk.gov.ru/rus/info.php?id=623747</a>, а также у операторов справочной службы Госкомрегистра по телефонам: +7 (3652) 66-74-00, +7 (978) 10-85-365, +7 (978) 22-82-974, +7 (978) 22-82-970, +7 (978) 22-83-043\r\n    </p></div>\r\n\r\n	<h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Система сообщает, что достигнут лимит регистрации. Что это значит? </h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вариант 1: Осуществить предварительную регистрацию в Системе можно не более одного раза в день. Если Система сообщает о лимите регистрации, значит сегодня Вы уже использовали эту возможность.<br>\r\n    Вариант 2: Система принимает только одну запись от одного пользователя на определенную дату. Если Система отказывает в регистрации, значит ранее Вы уже записались именно на эту дату. Попробуйте выбрать другое число для записи.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Система показывает, что отделение загружено не полностью (98%), но не выдает талон. Почему?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Это возможно в отделениях с одним окном приема граждан. Это значит, что время действительно есть, но его не достаточно для оказания выбранной Вами услуги.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Я просмотрел электронную очередь и увидел, что нет свободных дат на несколько лет вперед. Это значит, что все талоны разобраны на годы вперед?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Нет. Это значит, что в настоящее время электронная очередь не работает. Система открывается определенного числа и на определенный период (ориентировочно месяц) и закрывается после того, как все талоны выбраны.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Можно ли получить два талона в один день?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Нет, в сутки один заявитель может получить не более одного талона.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Можно ли зарегистрировать недвижимость, не в том отделении, которое предложила система, а там, где мне удобнее, например, по месту проживания?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Нет, регистрировать собственность, в настоящее время, можно только в том отделении, которое предложит система. \r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Могу ли я зарегистрироваться в системе, если у меня украинский паспорт?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Да, для этого в поле «Серия паспорта» нужно ввести «0000», а в поле «Номер паспорта» - номер своего украинского паспорта.\r\n    </p></div>    \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Где еще можно получить услуги предоставляемые Госкомрегистром?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Через многофункциональные центры (МФЦ), за дополнительной информацией обращайтесь по телефону 8-800-100-42-09.\r\n    </p></div>   \r\n     \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Для того чтобы забрать документы из Госкомрегистра нужно еще раз регистрироваться в электронной очереди?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Нет, для этого не нужна предварительная регистрация. Можно просто прийти в отделение Госкомрегистра. Справки по телефону: (3652)66-74-00\r\n    </p></div>    \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Я зарегистрировался в системе, но не получил на электронный ящик письмо с логином и паролем.</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вариант 1: Проверьте папку «Спам»<br>\r\n 	Вариант 2: Проверьте правильность написания электронного адреса.\r\n    </p></div>    \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Я забыл логин/пароль и не могу воспользоваться кнопкой «Забыли пароль», потому что не помню пароль и от своего почтового ящика.</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Опишите проблему в письменном виде, приложите скан-копию паспорта, напишите адрес электронной почты, от которой вы помните пароль. Отправьте письмо на электронный адрес техподдержки support@krtech.ru . На указанный вами адрес будет выслан логин и пароль.\r\n    </p></div>    \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Можно ли исправить ошибку, которую мы допустили, когда получали талон?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Ошибку можно исправит только в случае обращения к операторам техподдержки от специалистов Госкомрегистра.\r\n    </p></div>    \r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Я получил талон, что мне делать дальше?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">С талоном, выданным системой, нужно в выбранную дату к указанному времени (желательно заранее) прийти в отделение Госкомрегистра (адрес и номер отделения указан в талоне). В отделении ввести номер талона в терминал электронной очереди.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Кто попадает в число льготных категорий граждан?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">- Герои Советского Союза; <br>\r\n    - Герои Российской Федерации; <br>\r\n    - Полные кавалеры ордена Славы и их семьи; <br>\r\n    - Инвалиды и участники Великой Отечественной войны; <br>\r\n    - Лица, награжденные знаком «Жителю блокадного Ленинграда»; <br>\r\n    - Герои Социалистического труда и полные кавалеры ордена Трудовой Славы; <br>\r\n    - Ветераны боевых действий на территории СССР; <br>\r\n    - Инвалиды 1,2 групп; <br>\r\n    - Несовершеннолетние узники концлагерей; <br>\r\n    - Граждане с малолетними детьми до 1,5 года; <br>\r\n    - Граждане в пенсионном возрасте от 70 лет и старше; <br>\r\n    - Ветераны военной службы; <br>\r\n    - Ветераны государственной службы.<br>\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> На главной странице нет кнопки «войти» или «зарегистрироваться»</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вы используете не тот интернет-браузер. Повторите операцию в браузерах Mozilla Firefox или Google Chrome.\r\n    </p></div>\r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> При постановке в очередь, заполняя адрес, невозможно поставить курсор на поле «дом».</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вы используете не тот интернет-браузер. Повторите операцию в браузерах Mozilla Firefox или Google Chrome.\r\n    </p></div>\r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> При регистрации аккаунта невозможно поставить галочку «Согласен на обработку персональных данных». </h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Вы используете не тот интернет-браузер. Повторите операцию в браузерах Mozilla Firefox или Google Chrome.\r\n    </p></div>\r\n    \r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Почему я не могу ввести буквы с картинки? </h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Капча (буквы с картинки) вводится только тогда, когда заполнены все обязательные поля.\r\n    </p></div>\r\n\r\n    <h4 class=\"accordion-toggle text-color_1\"><span style=\"color:black;font-weight: bold\">•</span> Не нашли ответ на свой вопрос?</h4>\r\n    <div class=\"accordion-content default\" style=\"display: none;\">\r\n    <p class=\"item-card__description\">Обратитесь в справочную службу Госкомрегистра по телефонам +7 (3652) 66-74-00, +7 (978) 22-82-974, +7 (978) 22-82-970, +7 (978) 22-83-043\r\n    </p></div>\r\n</div>','2016-05-25 17:07:57'),(8,'Введите ссылку на страницу сюда...5555555555','Введите название страницы сюда...','Введите содержимое страницы сюда.','2016-06-21 11:39:27'),(9,'Введите ссылку на страницу сюда...','Введите название страницы сюда','Введите содержимое страницы сюда.','2016-07-01 12:03:06');
